import { connect } from "react-redux";
import React, { Component } from 'react';
import { deleteCity } from "./ac/deleteCity";
import PropTypes from 'prop-types';


class City extends Component{

    static propTypes = {

        number: PropTypes.number,
        increment: PropTypes.func,
        decrement: PropTypes.func

    };

    render () {
        const {city, deleteCity} = this.props;


        console.log(this.props.city);
        console.log(this.props.deleteCity);

        return (
            <div>
                <h3>{city.name}</h3>
                <h3>{city.temp}</h3>
                <button onClick={() => this.props.deleteCity(city.id)}>delete</button>
            </div>
        );
    }
}

const mapDispatchToProps = (dispatch) => ({
    deleteCity: (id) => dispatch(deleteCity(id))
});



connect(mapDispatchToProps)(City);


class CityList extends Component {


    render() {

        console.log(this.props.dataCity);

        const cityList = this.props.dataCity.map((data) => <City city = {data} key = {data.id} />);

        console.log(cityList);

        return (

            <div>{cityList}</div>
        );

    }

}

const mapStateToProps = (state) => ({
    dataCity: state.city
});

export default connect(mapStateToProps)(CityList);
